import MovieCard from "components/MovieCard";
import Pagination from "components/pagination";

function Listining() {

    return (
        <>
            <Pagination />
            <div className="container">
                <div className="row">
                    <div className="col-sm-6 ">
                        <MovieCard />
                    </div>
                </div>
            </div>
        </>
    );
}

export default Listining;
